import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const Books = () => {
  const [books, setBooks] = useState([]);

  useEffect(() => {
    let book = [
      {
        id: 1,
        title: "Atomic Habbits",
        author: "James Clear",
        releaseDate: "16 Oct 2018",
        rating: "4.8",
      },
      {
        id: 2,
        title: "The Stranger",
        author: "Albert Camus",
        releaseDate: "19 May 1942",
        rating: "4.4",
      },
      {
        id: 3,
        title: "The Old Man And The Sea",
        author: "Ernest Hemingway",
        releaseDate: "1952",
        rating: "4.2",
      },
    ];

    setBooks(book);
  }, []);

  return (
    <div className="container">
      <h2>Books</h2>
      <hr />
      <table className="table table-striped table-hover">
        <thead>
          <tr>
            <th>Books</th>
            <th>Author</th>
            <th>Release Date</th>
            <th>Ratings</th>
          </tr>
        </thead>
        <tbody>
          {books.map((b) => (
            <tr key={b.id}>
              <td>
                <Link to={`/books/${b.id}`}>{b.title}</Link>
              </td>
              <td>{b.author}</td>
              <td>{b.releaseDate}</td>
              <td>{b.rating}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Books;
